import React from "react";
import { Link } from "react-router-dom";

const Profile = (props) => {
    const {
        isLoggedIn,
        username
    } = props;
    return (
        <div>
            {
                isLoggedIn ? (<h3>Welcome to your {`${username}`}</h3>) : (<Link to="/login">Please login to view your profile</Link>) 
            }

            {
                isLoggedIn? (<p>Here are your posts</p>) : null
            }
        </div>

    )
}

export default Profile;
